import React from "react";
import { Route, Switch } from "react-router";

import Home from "./Home";
import About from "./About";

export default class AppRouter extends React.Component {
  componentDidUpdate() {
    console.log("asd");
  }

  render() {
    return (
      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/about">
          <About />
        </Route>
      </Switch>
    );
  }
}
